import React from 'react';
import { auth } from "../../services/firebase";
import {
	Route,
	BrowserRouter as Router,
	Switch
} from "react-router-dom";

function Index() {
    return (
		<Router>
			<Switch>
				<Route exact path="/product" component={Index}></Route>
                <Route path="/product/create" component={Create}></Route>
                <Route path="/product/edit" component={Edit}></Route>
                <Route path="/product/show" component={Show}></Route>
			</Switch>
		</Router>
    );
}

function Create() {
    return (
		<div>
            create
		</div>                
    );
}

function Edit() {
    return (
		<div>
            edit
		</div>                
    );
}

function Show() {
    return (
		<div>
            show
		</div>                
    );
}

export default Index;
